import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Bell, Search, Clock, MapPin, ArrowLeft, X } from 'lucide-react';

const Dashboard = ({ userName, events, searchTerm, setSearchTerm, regCount }) => {
  const navigate = useNavigate();
  const [isSearchActive, setIsSearchActive] = useState(false);

  return (
    <div style={{ padding: '16px', paddingBottom: '80px' }}>
      <header style={styles.header}>
        {!isSearchActive ? (
          <>
            <div style={styles.logoGroup}>
              <div style={styles.logoCircle}>ES</div>
              <span style={styles.brandName}>EventSphere</span>
            </div>
            <div style={{ display: 'flex', gap: '15px' }}>
              <Search size={22} onClick={() => setIsSearchActive(true)} style={{cursor: 'pointer'}} />
              <Bell size={24} onClick={() => navigate('/notifications')} style={{cursor: 'pointer'}} />
            </div>
          </>
        ) : (
          <div style={styles.searchHeaderFull}>
            <ArrowLeft size={24} onClick={() => { setIsSearchActive(false); setSearchTerm(""); }} />
            <input autoFocus type="text" placeholder="Search events..." style={styles.fullInput} value={searchTerm} onChange={(e) => setSearchTerm(e.target.value)} />
            {searchTerm && <X size={20} onClick={() => setSearchTerm("")} />}
          </div>
        )}
      </header>

      <div style={{ marginTop: '20px' }}>
        <h1 style={{ fontSize: '28px', fontWeight: 'bold', margin: 0 }}>Hi {userName} ðŸ‘‹</h1>
        <p style={{ color: '#94a3b8', fontSize: '14px' }}>Explore college events</p>
      </div>

      <div style={styles.statsGrid}>
        <div style={styles.statCard}><span style={styles.statLabel}>Upcoming</span><div style={styles.statValue}>{events.length}</div></div>
        <div style={styles.statCard}><span style={styles.statLabel}>Registered</span><div style={styles.statValue}>{regCount}</div></div>
      </div>

      <h3 style={{ marginTop: '20px' }}>Upcoming Events</h3>
      <div style={styles.horizontalScroll}>
        {events.map(event => (
          <div key={event.id} style={styles.eventCard}>
            <div style={{ ...styles.banner, backgroundImage: `url(${event.image})` }} />
            <div style={{ padding: '12px' }}>
              <h4 style={{ margin: '0 0 8px 0' }}>{event.title}</h4>
              <div style={styles.iconRow}><Clock size={12} /> <span style={{marginLeft: '5px'}}>{event.date}</span></div>
              <div style={styles.iconRow}><MapPin size={12} /> <span style={{marginLeft: '5px'}}>{event.location}</span></div>
              <button style={styles.regBtn}>Register</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

const styles = {
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', height: '50px' },
  logoGroup: { display: 'flex', alignItems: 'center', gap: '8px' },
  logoCircle: { width: '32px', height: '32px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' },
  brandName: { fontWeight: 'bold', fontSize: '18px' },
  searchHeaderFull: { display: 'flex', alignItems: 'center', width: '100%', gap: '10px' },
  fullInput: { flex: 1, padding: '10px', borderRadius: '20px', border: 'none', backgroundColor: '#f1f5f9' },
  statsGrid: { display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '12px', marginTop: '20px' },
  statCard: { backgroundColor: '#f8fafc', padding: '16px', borderRadius: '12px', border: '1px solid #f1f5f9' },
  statLabel: { fontSize: '12px', color: '#64748b' },
  statValue: { fontSize: '20px', fontWeight: 'bold' },
  horizontalScroll: { display: 'flex', gap: '15px', overflowX: 'auto', paddingBottom: '10px' },
  eventCard: { minWidth: '280px', borderRadius: '16px', border: '1px solid #f1f5f9', overflow: 'hidden' },
  banner: { height: '140px', backgroundSize: 'cover', backgroundPosition: 'center' },
  iconRow: { display: 'flex', alignItems: 'center', fontSize: '11px', color: '#64748b', marginBottom: '4px' },
  regBtn: { backgroundColor: '#2563eb', color: '#fff', border: 'none', padding: '10px', borderRadius: '8px', width: '100%', marginTop: '8px', fontWeight: 'bold' }
};

export default Dashboard;
